export class AppComponent {
  title = 'ProEvents-App';
}
<div class="container texte-center">
  <h1>Events</h1>
  <app-events></app-events>

  <h1>Speakers</h1>
  <app-speakers></app-speakers>

  <router-outlet></router-outlet>
</div>
